import React from "react";
import Header from "./Header.js";
import Home from "./Home.js";
import Footer from "./Footer.js"

let Componant = function(){
    return(
        <div>
            <table className="table">
                <Header></Header>
                <Home></Home>
                <Footer></Footer>
            </table>
        </div>
    );
}

export default Componant ;
